import './Name.css';
import Media from 'react-media';

// This is name view 
export default function ReturnName() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => (
 <div className='wrp-name-wel-dash'>
  <ViewName firstName={props.firstName} lastName={props.lastName} />
 </div>
);
export const ScreenSmall = (props) => (
 <div className='wrp-name-wel-dash-sm'>
  <ViewName firstName={props.firstName} lastName={props.lastName} />
 </div>
);
export const ViewName = (props) => (
 <>
  <span>{props.firstName}</span>
  <span>{props.lastName}</span>
 </>
);
